package com.example;

public class Flow 
{
 private String name;
 private String docId;
public Flow() {
	super();
	// TODO Auto-generated constructor stub
}
public Flow(String name, String docId) {
	super();
	this.name = name;
	this.docId = docId;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
public String getDocId() {
	return docId;
}
public void setDocId(String docId) {
	this.docId = docId;
}
 
}
